window.bookSummaryJSON = "<p><b>Another timeless story about Mary Poppins, the world's favorite nanny, and her magical adventures with the Banks family</b>. </p> <p>From the moment Mary Poppins arrives at Number Seventeen Cherry Tree Lane, everyday life at the Banks house is forever changed. Jane, Michael, and the twins have never had such a wonderful nanny, who brings enchantment and excitement everywhere she goes. </p> <p>In <i>Mary Poppins Comes Back</i>, the beloved nanny returns when she's pulled down from the clouds by the string of Michael's kite. In her care, the Banks children meet the King of the Castle and the Dirty Rascal, visit the upside-down world of Mr. Turvy and his bride, Miss Topsy, and spend a breathless afternoon above the park, dangling from a clutch of balloons. Surprises are sure to pop up when Mary Poppins is around!</p>"; 
